import React from 'react';

import circlePlaceholder from './Icons/circlePlaceholder.png';
import CompanyCard from './Components/CompanyCard';

const SecondPage = () => (


  <div className='page second-page' id='second-page'>
     {/* First Section: Download Resume | WORK EXPERIENCE Title | Image Working Lady*/}
     <div className='second-page-header'>
        {/* Round Button Download Resume and text */}
        <div className="download-cv-btn">
            <img src = {circlePlaceholder} alt="Placeholder" className="round-btn-header-img" />
        </div>

        {/* Work title and image */}
        <div className='second-page-work-div'>
            {/* Text: WORK EXPERIENCE */}
            <div className="second-page-title-div">
                <h2 className="second-page-title">WORK</h2>
                <h2 className="second-page-title">EXPERIENCE</h2>
            </div>

            {/* Image Working Lady */}
            <div className="second-page-girl-div">
                <img src = {circlePlaceholder} alt="Placeholder" className="first-page-girl-img" />
            </div>
        </div>  
     </div>
     <div className='company-card-titles-div'>
            <CompanyCard
                icon = {circlePlaceholder}
                title = {'Oracle'} /**https://docs.oracle.com/en/applications/jd-edwards/financials/9.2/eoaap/accounts-payable-overview.html */
                date = {'Jan 2018 - Oct 2021'}
                texts = {[' I worker on Web Development for an ERP. The project had a microservices structure and I was the UI Lead! I also drove the Automation project, served as Scrum Master and intervened on the backend. I learned so much about so many things, and the people.. UH! My favorite part no question.', 'Coding Languages: JavaScript, Java']}
            ></CompanyCard>
            <CompanyCard
                icon = {circlePlaceholder}
                title = {'Microsoft'} /**https://www.microsoft.com/en-us/microsoft-teams/microsoft-mesh */
                date = {'Oct 2021 - Mar 2023'} /** https://learn.microsoft.com/en-us/windows/mixed-reality/mrtk-unity/mrtk3-overview/ */
                texts = {["I worked on XR Development for Microsoft Mesh. If you go on 'edit mode' and edit rooms, that is exactly what I worked on! It was such a fun project to be a part of. I also got to advocate for MRTK component's accessibility, I researched about legal, I created personas, created a plan based on priorities.. Such an interesting process to get involved with, it actually inspired me to take a google course on Project Management.",
                    "Coding Languages: C#"]}
            ></CompanyCard>
            <CompanyCard
                icon = {circlePlaceholder}
                title = {'Qualcomm'}
                date = {'Apr 2023 - Sep 2024'} /** https://www.qualcomm.com/products/mobile/snapdragon/xr-vr-ar/snapdragon-xr2-gen-2-platform?&cmpid=pdsrc-JmW4rVRYGT&utm_medium=pdsrc&utm_source=AW&utm_campaign=FS-XR&_bt=689448412705&_bk=qualcomm%20xr&_bm=e&_bn=g&_bg=134018438337&gad_source=1&gclid=CjwKCAiAnpy9BhAkEiwA-P8N4tihOhUfccL4DO2LPb56Rqw2PcC6mjA_ryAXKKc3fHbjdtjUj0za9hoC4BoQAvD_BwE */
                texts = {["I worked on the development of Qualcomm's system Shell for XR. So basically, if you use any headset that is powered by Snapdragons chipset and it works... I WORKED ON THAT! How lucky am I to be able to say that, right?", 
                        "Coding Languages: C#"]}
            ></CompanyCard>
    </div>

  </div>
);

export default SecondPage;
